# Helper functions for assertions
expect_equal <- function(actual, expected) {
    if (!identical(actual, expected)) {
        stop(sprintf("Expected %s but got %s", toString(expected), toString(actual)))
    }
}

expect_true <- function(condition) {
    if (!isTRUE(condition)) {
        stop("Expected TRUE but got FALSE")
    }
}

expect_false <- function(condition) {
    if (!isFALSE(condition)) {
        stop("Expected FALSE but got TRUE")
    }
}

expect_null <- function(value) {
    if (!is.null(value)) {
        stop(sprintf("Expected NULL but got %s", toString(value)))
    }
}

expect_gte <- function(actual, expected) {
    if (!(actual >= expected)) {
        stop(sprintf("Expected value >= %s but got %s", toString(expected), toString(actual)))
    }
}
